  null,\n\t\"notes\": \"CALWATER provides a standard nested watershed delineation
  scheme using the State Water Resources Control Board numbering scheme. The hierarchy
  of watershed designations consists of six levels of increasing specificity: Hydrologic
  Region (HR), Hydrologic Unit (HU), Hydrologic Area (HA), Hydrologic Sub-Area (HSA),
  Super Planning Watershed (SPWS), and Planning Watershed (PWS). The primary purpose
  of Calwater is the assignment of a single, unique code to a specific watershed polygon.\",\n\t\"license_title\":
